import React, { Component } from 'react'
import { connect } from 'react-redux'
import { bindActionCreators } from 'redux'
import EmpAction from './../../actions/empaction'

 class Rrc extends Component 
 {
   
  constructor(props) 
  {
    super(props)
  
    this.state = {}
  }
  
  componentDidMount()
  {
      this.props.EmpAction()
  }




  render() {
    return (<>
                <div className="container text-center p-3">
                    <h2>React_Redux Connection</h2>

                </div>
           </>)
  }
}

const mapStateToProps = (st)=>
{
    console.log(state)

   return({
       empdata:state.empReducer
   })
}

const mapDispatchToProps = (dispatch)=>
{
      return bindActionCreators({EmpAction},dispatch)
}


export default connect(mapStateToProps,mapDispatchToProps)(Rrc);
